const userModels = require('./user-models.js');

const User = userModels.User;
const Student = userModels.Student;
const Admin = userModels.Admin;

/**
 * Callback for {@link createUser}
 * @typedef {Object} CreateUserCallback
 * @param {Object} err - The error.
 * @param {Number} id - The user UID.
 */

/**
 * Given User information, create a User.
 * @param {Object} data - The request body data.
 * @param {String} data.role - The user role.
 * @param {String} data.email - The user email address.
 * @param {String} data.password - The user password.
 * @param {CreateUserCallback} next - The callback function to run after this function
 *     finishes.
 */
const createUser = (data, next) => {
  // Ensure the required data is available.
  if (!data) {
    next({ err: 'Required parameters not found.' });
    return;
  }

  const info = {
    email: data.email,
    password: data.password,
    name: data.name,
    role: data.role,
  };

  let user;

  if (data.role === 'student') {
    // Create a student.
    info.studentId = data.studentId;
    user = new Student(info);
  } else if (data.role === 'admin') {
    // Create an admin.
    user = new Admin(info);
  } else {
    next({ err: 'Valid role not found.' });
    return;
  }

  User.findOne({ email: user.email }, (userErr, existingUser) => {
    if (userErr) {
      next(userErr);
    } else if (existingUser) {
      next({ err: 'Account with that email address already exists.' });
    } else {
      user.save((saveErr, dbUser) => {
        next(saveErr, (dbUser || {}).id);
      });
    }
  });
};

/**
* Callback for {@link modifyUser}
* @typedef {Object} ModifyUserCallback
* @param {Object} - The error
* @param {UserSchema} - The modified user object
*/


 /**
 * Updates the user with the passed in values.
 * This method does NOT delete fields
 * @param {string} userUid - The UID of the user to be updated
 * @param {Object} reqData - The request data
 * @param {Object} locals
 * @param {ModifyUserCallback} modifyCallback
 */
const modifyUser = (userUid, reqData, locals, modifyCallback) => {
  const conditions = { _id: userUid };
  const update = {};

  Object.keys(reqData).forEach((key) => {
    update[key] = reqData[key];
  });

  const options = { new: true };

  Student.findOneAndUpdate(conditions, { $set: update }, options, modifyCallback);
};

/**
* Callback for {@link deleteUser}
* @typedef {Object} DeleteUserCallback
* @param {Object} - error
*/



/**
* Deletes the user from the database.
* @param {string} userUid - The UID of the user to be updated.
* @param {Object} locals
* @param {DeleteUserCallback} deleteCallback
*/
const deleteUser = (userUid, locals, deleteCallback) => {
  User.findOneAndremove({ _id: userUid }, deleteCallback);
};


/**
* Callback for {@link getUserById}
* @typedef {Object} GetUserCallback
* @param {Object} - error
* @param {UserSchemas} - Retrieved user
*/

/**
* Retrieves the user.
* @param {string} userUid - The UID of the user to be updated
* @param {Object} locals
* @param {GetUserCallback} queryCallback
*/
const getUserById = (userUid, locals, queryCallback) => {
  User.findById(userUid, (err, results) => {
    if (err) {
      queryCallback(err);
      return;
    }
    const user = {
      uid: results.id,
      email: results.email,
      name: results.name,
      role: results.role,
    };

    if (user.role === 'student') {
      user.points = results.points;
      user.isApproved = results.isApproved;
    }

    queryCallback(err, user);
  });
};


module.exports = { createUser, modifyUser, deleteUser, getUserById };

const mongoose = require('mongoose');
const bcrypt = require('bcrypt');

const Schema = mongoose.Schema;

const options = { discriminatorKey: 'type' };
const pointOption = {
  type: Number,
  required: true,
  default: 0,
};

/**
* User Object
* @typedef {Object} UserSchema
* @param {string} name - Screen name for user
* @param {string} firstName - DEPRECATED
* @param {string} lastName - DEPRECATED
* @param {string} email
* @param {string} password
* @param {string} role - ENUM: student, admin
* @param {boolean} isApproved
*/
const userSchema = new Schema({
  name: String,
  firstName: String,
  lastName: String,
  email: {
    type: String,
    unique: true,
    required: true,
  },
  password: {
    type: String,
    required: true,
  },
  role: {
    type: String,
    enum: ['student', 'admin'],
    required: true,
  },
  isApproved: {
    type: Boolean,
    required: true,
    default: false,
  },
}, options);

/**
*  Updates and saves the user's password
*/
userSchema.pre('save', function pre(next) {
  const user = this;

  // If the password is not modified, continue saving the user.
  if (!user.isModified('password')) {
    next();
    return;
  }

  bcrypt.genSalt(Number(process.env.SALT), (saltErr, salt) => {
    if (saltErr) {
      next(saltErr);
      return;
    }

    bcrypt.hash(user.password, salt, (hashErr, hash) => {
      user.password = hash;
      next(hashErr);
    });
  });
});


/**
* Callback for {@link userSchema.methods.comparePassword}
* @typedef {Object} ComparePasswordNext
* @param {Object} err - error
* @param {boolean} isMatch - Whether or not the passwords matched
*/

/**
* Helper method to check users password
* @param {string} password - The password to be compared to the user's password
* @param {ComparePasswordNext} next
*/
userSchema.methods.comparePassword = function comparePassword(password, next) {
  bcrypt.compare(password, this.password, (err, isMatch) => {
    next(err, isMatch);
  });
};

const studentSchema = new Schema({
  points: {
    career: pointOption,
    community: pointOption,
    firstother: pointOption,
    firstworkshops: pointOption,
    mentor: pointOption,
    other: pointOption,
    outreach: pointOption,
    professor: pointOption,
    staff: pointOption,
    misc: pointOption,
  },
  studentId: {
    type: String,
  },
}, options);

const adminSchema = new Schema({}, options);

const User = mongoose.model('User', userSchema);

const Student = User.discriminator('student', studentSchema);
const Admin = User.discriminator('admin', adminSchema);

module.exports = { Student, Admin, User };

const express = require('express');
const userManager = require('./user-manager');
const authManager = require('../auth/auth-manager');

const userRouter = express.Router();

/**
 * Route for creating a new user
 *
 * @endpoint /
 * @verb POST
 * @param {Object} req        Express request object
 * @param {USER}   req.body   User to be created
 * @param {Object} res        Express result object
 * @param {string} res.body   UID of the created user if successful, else the
 *                            error message
 * @param {number} res.status Indicates success or not
 */
userRouter.post('/', (req, res) => {
  userManager.createUser(req.body, (err, uid) => {
    if (err) {
      res.status(400).json(err).end();
    } else {
      // A User was created.
      res.status(201).json({ uid }).end();
    }
  });
});

/**
 * Route for modiying an existing user
 *
 * @endpoint /
 * @verb PUT
 * @param {Object}      req           Express request object
 * @param {string}      req.query.uid (OPTIONAL) UID of user ot be modified
 * @param {USER}        req.body      Updated fields of the user
 * @param {Object}      res           Express result object
 * @param {number}      status        200 on success, 400 if error
 * @param {USER|string} res.body      Modified user | error message
 * @param {TOKEN}       token         Admin | Modified User
 */
userRouter.put('/',
    authManager.verify,
    authManager.validateUidPermissions,
    (req, res) => {
      userManager.modifyUser(res.locals.uid, req.body, res.locals,
        (err, user) => {
          if (err) {
            res.status(400).json(err).end();
            return;
          }
          res.status(200).json(user).end();
        });
    });

/**
 * Route for deleting an existing user
 *
 * @endpoint /
 * @verb DELETE
 * @param {Object} req           Express request object
 * @param {string} req.query.uid (OPTIONAL) UID of user to be deleted
 * @param {TOKEN}  token         Admin | User to be deleted
 * @param {Object} res           Express result object
 */
userRouter.delete('/',
    authManager.verify,
    authManager.validateUidPermissions,
    (req, res) => {
      userManager.deleteUser(res.locals.uid, res.locals, (err, result) => {
        if (err) {
          res.status(400).json(err).end();
          return;
        }
        res.status(200).json(result).end();
      });
    });

/**
 * Route for getting an existing user
 *
 * @endpoint /
 * @verb GET
 * @param {Object} req           Express request object
 * @param {string} req.query.uid (OPTIONAL) UID of user to be retrieved
 * @param {TOKEN}  token          Admin | User being retrieved
 * @param {Object} res            Express result object
 */
userRouter.get('/',
    authManager.verify,
    authManager.validateUidPermissions,
    (req, res) => {
      const uid = res.locals.uid;
      userManager.getUserById(uid, {}, (err, user) => {
        if (err) {
          res.status(400).send(err).end();
          return;
        }

        if (!user) {
          res.status(404).end();
          return;
        }

        res.status(200).json(user).end();
      });
    });

module.exports = { userRouter };
